function currentTimezoneToUTC(time) {
  return moment(time).add(-1 * timezoneToHour(user.time_zone), 'hour');
}

//-------------------------------------------------------------------------------------
function objToUTC(obj) {
  var start = obj.start_date + ' ' + obj.start_time;
  var end = obj.end_date + ' ' + obj.end_time;

  start = currentTimezoneToUTC(moment(start));
  end = currentTimezoneToUTC(moment(end));

  obj.start_date = start.format('YYYY-MM-DD');
  obj.start_time = start.format('HH:mm:ss');
  obj.end_date = end.format('YYYY-MM-DD');
  obj.end_time = end.format('HH:mm:ss');
}

//-------------------------------------------------------------------------------------
function utcToCurrentTimezone(time) {
  return moment(time).add(timezoneToHour(user.time_zone), 'hour');
}

//-------------------------------------------------------------------------------------
function objToCurrentTimezone(obj) {
  if (obj.start_time && obj.end_time) {
    var start = obj.start_date + ' ' + obj.start_time;
    var end = obj.end_date + ' ' + obj.end_time;

    start = utcToCurrentTimezone(moment(start));
    end = utcToCurrentTimezone(moment(end));

    obj.start_date = start.format('YYYY-MM-DD');
    obj.start_time = start.format('HH:mm:ss');
    obj.end_date = end.format('YYYY-MM-DD');
    obj.end_time = end.format('HH:mm:ss');
  }
}

//-------------------------------------------------------------------------------------
function timezoneToHour(tz) {
  var hour = parseInt(tz.substr(1,2));
  var minute = parseInt(tz.substr(4,2));

  switch(tz.substr(0, 1)) {
    case '+':
      return hour + minute / 60;
      break;

    case '-':
      return -1 * (hour + minute / 60);
      break;
  }
  return false;
}

