//-------------------------------------------------------------------------------------
function popupText(data) {
  try {
    data = JSON.parse(data);
  } catch(e) { }

  switch(jQuery.type(data)) {
    case 'object':
      var t = [];

      $.each(data, function(key,val) {
        t = t.concat(val);
      });

      data = t;
      break;
    case 'array':
      break;
    default:
      data = [data];
      break;
  }

  var result = '<ul class="error-popup">';

  for (var i = 0; i < data.length; i++) {
    result += '<li>' + data[i] + '</li>';
  }

  result += '</ul>';

  return result
}

