main_app.directive('initAccountSelect2', function () {
  return {
    restrict: 'A',
    scope: {
      rooms: '=rooms',
      room: '=room',
    },
    link: function(scope, element, attr) {

      // FUNCTION CHECK EXIST MEMBERS
      function check_exist_members(rooms, obj) {
        exist = false;
        $.each(rooms, function(index, room) {
          $.each(room.members, function(i, member) {
            if (obj.id) {
              if (member.id == obj.id) return exist = true;
            } else {
              if (member.email == obj.email) return exist = true;
            }
          });
          if (exist == true) return exist = true;
        });
        return exist;
      }

      // INIT ACCOUNT SELECT2
      options = {
        placeholder: api_lang.select_members,
        type: ['user', 'customer']
      };

      init_account_select2(element, options);

      // EVENT SELECT
      element.on('select2:select', function (e) {
        scope.$apply(function() {
          if (!scope.room.members) scope.room.members = [];

          var exist = check_exist_members(scope.rooms, e.params.data.data);

          if (!exist) {
            e.params.data.data.join_option = 'need';
            scope.room.members.push(e.params.data.data);
          } else {
            showErrors(api_lang.member_already_exists);
          }

          element.val(null).trigger('change');
        });
      });

      // EVENT ENTER ( NEW EMAIL CUSTOMER )
      element.data('select2').$dropdown.addClass(scope.room.id)

      $class_name = 'span.select2-container.select2-container--default.select2-container--open.' + scope.room.id;

      $(document).on('keyup', $class_name + ' .select2-search__field', function (e) {
        var email = $(this).val();

        scope.$apply(function() {
          if (e.which == 13) {
            if (isEmail(email)) {
              var new_account = {
                email: email,
                group_code: '3',
                join_option: 'need',
                type: 'customer',
              };

              if (!scope.room.members) scope.room.members = [];

              var exist = check_exist_members(new_account);

              if (!exist) {
                scope.room.members.push(new_account);
                element.select2('close');
              } else {
                showErrors(api_lang.member_already_exists);
              }
            } else {
              showErrors(api_lang.email_is_invalid);
            }
          }
        });
      });
    } // END LINK
  };
});

