main_app.directive('countdown', function () {
  return {
    restrict: 'E',
    replace: true,
    template: '<span class="noti-time"></span>',
    scope: {
      schedule: '='
    },
    link: function(scope, element, attr) {
      element.countdown(scope.schedule.start_date + ' ' + scope.schedule.start_time, function(event) {
        if (event.strftime('%N') < 10 )
          element.html(event.strftime('%N:%S'));
      });
    }
  };
});

