main_app.controller('AbstractController', function($scope, $rootScope, $location) {

  //----------------------------------------------------------------------------------
  AbstractSockets($scope);

  //----------------------------------------------------------------------------------
  $scope.isAdminPermission = isAdminPermission;
  $scope.isRoomManagerPermission = isRoomManagerPermission;
  $scope.isRoomAccountPermission = isRoomAccountPermission;
  $scope.bind_content_notification = bind_content_notification;
  $scope.datetimeString = datetimeString;
  $scope.utcToCurrentTimezone = utcToCurrentTimezone;

  //----------------------------------------------------------------------------------
  load_notifications($scope);

  //----------------------------------------------------------------------------------
  $scope.active_main_menu = function(action) {
    return $location.$$path.indexOf(action) !== -1;
  };

  //----------------------------------------------------------------------------------
  $scope.active_group = function(group_id) {
    return $location.$$path.replace(current_path, '') == group_id;
  };

  //----------------------------------------------------------------------------------
  $scope.change_tab = function(e, id) {
    $('.nav-tabs a[href="' + id + '"]').tab('show');

    // remove 'ac-' from img src
    var img = $('.nav-tabs img[src^="' + img_url + 'ac-"]');
    var src = img.attr('src').replace(img_url + 'ac-', img_url);
    img.attr('src', src);

    // add 'ac-' to img src
    var img = $('.nav-tabs a[href="' + id + '"] > img');
    var src = img.attr('src').replace(img_url, img_url + 'ac-');
    img.attr('src', src);

    e.preventDefault();
  };

  //----------------------------------------------------------------------------------
  $scope.link_to_reception = function() {
    if ($('#reception-company').select2('val'))
      $location.path('/reception/' + $('#reception-company').select2('val') + '/' + current_lang);

    return false;
  }

  //----------------------------------------------------------------------------------
  $scope.change_language = function(lang) {
    $.ajax({
      url: base_url + 'api/languagechanges/update',
      type: 'GET',
      data: { lang: lang },
      dataType: 'json',
      success: function(e) {
        $scope.$apply(function() {
          switch(e.code) {
            case '500':
              showErrors(e.msg);
              break;
            case '200':
              location.href = location.href;
              break;
          }
        });
      }
    });
  }

  //----------------------------------------------------------------------------------
  $scope.logout = function() {
    $.ajax({
      url: base_url + 'api/auths/logout',
      type: 'GET',
      dataType: 'json',
      success: function(e) {
        $scope.$apply(function() {
          switch(e.code) {
            case '500':
              showErrors(e.msg);
              break;
            case '200':
              socket.emit('disconnect');

              location.href = 'login';
              break;
          }
        });
      }
    });
  }

  //----------------------------------------------------------------------------------
  $scope.pick_up = function() {
    $.ajax({
      url: base_url + 'api/customers/pick_up',
      type: 'POST',
      data: {
        schedule_id: $scope.schedule.id,
        account_id: $scope.schedule.member.id,
      },
      dataType: 'json',
      success: function(e) {
        $scope.$apply(function() {
          switch(e.code) {
            case '500':
              showErrors(e.msg);
              break;
            case '200':
              $scope.schedule.receptionist = e.data;

              // REALTIME
              emitData = {
                schedule_id: $scope.schedule.id,
                type: 'just_member',
                eventName: 'pick_up',
                eventData: { data: e.data },
              };

              socketEmit(emitData);

              $('#customerArrive').modal('hide');
              break;
          }
        });
      }
    });
  }

  //----------------------------------------------------------------------------------
  $scope.mark_read = function(notification) {
    $.ajax({
      url: base_url + 'api/notifications/mark_read',
      type: 'POST',
      data: notification,
      dataType: 'json',
      success: function(e) {
        $scope.$apply(function() {
          switch(e.code) {
            case '500':
              showErrors(e.msg);
              break;
            case '200':
              location_url($location, notification.url);

              load_notifications($scope);

              // REALTIME
              data = {
                receivers: [user.id],
                data: e.data,
              };

              socket.emit('mark_read', data);
              break;
          }
        });
      }
    });
  }

});

