main_app.controller('BookingListIndexController', function($scope, $rootScope, $location, $stateParams) {

  //----------------------------------------------------------------------------------
  var interval = setInterval(function() {
    if ($rootScope.first_load == false) {
      $rootScope.first_load = true;

      $scope.$apply(function() {
        $scope.init_js();
      });

      clearInterval(interval);
    }
  }, 100);

  //----------------------------------------------------------------------------------
  $scope.init_js = function() {
    // DATATABLE
    $scope.datatable = $('#tbl-data').DataTable({
      order: [[ 3, 'asc' ]],
      columnDefs: [
        { targets: [ 3, 6 ], class: 'text-center' },
        (user.group_code == 1 || user.group_code == 2) ? { targets: [ 7 ], sortable: false, searchable: false, class: 'text-center actions' } : {},
        {
          render: function ( data, type, row ) {
            data = utcToCurrentTimezone(moment(data));
            return datetimeString(data, current_lang);
          },
          targets: [ 3 ],
        },
      ],
      deferLoading: 0, // DISABLE INIT SEARCH TO SEARCH WITH CONDITION
      processing: true,
      serverSide: true,
      displayStart: 0,
      displayLength: 7,
      ajax: {
        url: base_url + 'api/schedules/search_booking_list_datatable'
      }
    });

    // INIT DATEPICKER
    init_datepicker();

    // SELECT2 COMPANIES
    init_company_select2();

    // INIT TYPES OF SCHEDULE
    $.ajax({
      url: base_url + 'api/schedules/get_type_schedules',
      type: 'GET',
      dataType: 'json',
      beforeSend: function() {
        showPageLoading();
      },
      success: function(e) {
        $scope.$apply(function() {
          switch(e.code) {
            case '500':
              showErrors(e.msg);
              break;
            case '200':
              $scope.types = e.data;
              break;
          }
        });
      },
      complete: function() {
        hidePageLoading();
      }
    });

    $scope.search_datatable();
  };

  //----------------------------------------------------------------------------------
  $scope.search_datatable = function() {
    var start = moment($('.date-search').val()).startOf('day');
    var end = moment($('.date-search').val()).endOf('day');

    start = currentTimezoneToUTC(start);
    end = currentTimezoneToUTC(end);

    var from_date = $('.date-search').val() ? start.format('YYYY-MM-DD HH:mm:ss') : '';
    var to_date = $('.date-search').val() ? end.format('YYYY-MM-DD HH:mm:ss') : '';

    var date = from_date + ',' + to_date;

    var company_id = $('.select-company').select2('val') || '';

    var type = $('.select-type').val() || '';

    $scope.datatable.columns(2).search(company_id)
                    .columns(3).search(date)
                    .columns(5).search(type)
                    .draw();
  };

  //----------------------------------------------------------------------------------
  $scope.clear = function() {
    $('.date-search').val(moment().format('YYYY-MM-DD'));
    $('.select-company').val(null).trigger('change');
    $('.select-type').val(null);

    $scope.search_datatable();
  };

  //----------------------------------------------------------------------------------
  $scope.back = function() {
    history.back()
  };

  //----------------------------------------------------------------------------------
  $scope.delete_row = function(row) {
    confirmPopup(api_lang.delete_schedule, api_lang.are_you_sure_you_want_to_delete_schedule_var.replace(':var', row.title), function() {
      $.ajax({
        url: base_url + 'api/schedules/delete',
        type: 'POST',
        data: { id: row.id },
        dataType: 'json',
        beforeSend: function() {
          showPageLoading();
        },
        success: function(e) {
          $scope.$apply(function() {
            switch(e.code) {
              case '500':
                showErrors(e.msg);
                break;
              case '200':
                showSuccesses(e.msg);

                // REALTIME
                emitData = {
                  schedule_id: row.id,
                  type: 'schedule',
                  eventName: 'delete_schedule',
                  eventData: { data: [row.id] },
                };

                socketEmit(emitData);

                $scope.datatable.draw();
                break;
            }
          });
        },
        complete: function() {
          hidePageLoading();
          $('#modalViewSchedule').modal('hide');
        }
      });
    })
  }

});
