      return showErrors(errors);

    $.ajax({
      url: base_url + 'api/rooms/update',
      type: 'POST',
      data: $scope.submit_data,
      dataType: 'json',
      beforeSend: function() {
        showPageLoading();
      },
      success: function(e) {
        $scope.$apply(function() {
          switch(e.code) {
            case '500':
              showErrors(e.msg);
              break;
            case '200':
              showSuccesses(e.msg);

              socket.emit('update_room', e.data.account.id);

              $location.path('/rooms');
              break;
          }
        });
      },
      complete: function() {
        hidePageLoading();
      }
    });
