      order: [[ 0, "desc" ]],
      columnDefs: [
        { "targets": [ 0, 3, 5 ], "class": "text-center" },
        { "targets": [ 7 ], "visible": false },
        {
          "render": function ( data, type, row ) {
            data = utcToCurrentTimezone(moment(data));
            return datetimeString(data, current_lang);
          },
          "targets": [ 7 ],
        },
      ],
      deferLoading: 0, // DISABLE INIT SEARCH TO SEARCH WITH CONDITION
      processing: true,
      serverSide: true,
      displayStart: 0,
