function roomStatuseIndexSockets($scope) {

  //----------------------------------------------------------------------------------
  ['create_schedule', 'update_schedule', 'delete_schedule', 'update_time', 'expand_time', 'checkin', 'checkout'].forEach(function(eventName) {
    socket.on(eventName, function(data) {
      $scope.$apply(function() {

        $scope.get_next_schedule();
        $scope.search_booked_rooms();

        // CLOSE MODAl
        $('.modal').modal('hide');
      });
    });
  });

  //----------------------------------------------------------------------------------
  ['update_room'].forEach(function(eventName) {
    socket.on(eventName, function(data) {
      $scope.$apply(function() {
        $.ajax({
          url: base_url + 'api/sessions/reset_session_user',
          type: 'GET',
          dataType: 'json',
          success: function(e) {
            $scope.$apply(function() {
              switch(e.code) {
                case '500':
                  showErrors(e.msg);
                  break;
                case '200':
                  window.location.reload();
                  break;
              }
            });
          }
        });
      });
    });
  });

  //----------------------------------------------------------------------------------
  $scope.$on('$destroy', function() {

    ['create_schedule',
     'update_schedule',
     'delete_schedule',
     'update_time',
     'expand_time',
     'checkin',
     'checkout',
     'update_room'].

    forEach(function(eventName) {
      socket.off(eventName);
    });
  })
}

