// show setting colleague
function showSettingColleague(event) {
  var offset = $(event.target).offset();

  if ($(window).width() < 768) {
    $('.cal-list-menu-popup').css({
      display: 'block',
      top: offset.top + 13 - scroll,
      left: 0,
      'z-index': 999
    });
  } else {
    $('.cal-list-menu-popup').css({
      display: 'block',
      top: offset.top + 13 - scroll,
      left: offset.left,
      'z-index': 999
    });
  }
}

// hide setting colleague
function hideSettingColleague(event) {
  var cal_list_menu_popup = $('.cal-list-menu-popup');

  if (!$(event.target).is('.cal-list-menu-popup') && cal_list_menu_popup.is(':visible')) {
    cal_list_menu_popup.fadeOut('fast');
    return false;
  }
}

// show cal-list-menu-popup
var flag = null;
var offset = 0;

$(document).on('click', '.calListImg', function(event) {
  event.stopPropagation();

  offset = $(event.target).offset();
  if (flag == this) {
    if (!$('.cal-list-menu-popup').is(':visible'))
      showSettingColleague(event);
    else
      hideSettingColleague(event);
  } else {
    showSettingColleague(event);
    flag = this;
  }
});

