main_app.controller('ScheduleNewController', function($scope, $rootScope, $location) {

  //----------------------------------------------------------------------------------
  scheduleInfoSockets($scope, $location);

  //----------------------------------------------------------------------------------
  var interval = setInterval(function() {
    if ($rootScope.first_load == false) {
      $rootScope.first_load = true;

      $scope.$apply(function() {

        $scope.submit_data = {};
        $scope.init_js();
      });

      clearInterval(interval);
    }
  }, 100);

  //----------------------------------------------------------------------------------
  $scope.init_js = function() {

    // INIT FUNCTION
    var helpers = schedule_info_helpers;
    helpers.setScope($scope, $rootScope, $location);

    $scope.class_timeline = classTimeline;
    $scope.repeat_string = helpers.repeat_string;
    $scope.choice_color = helpers.choice_color;
    $scope.change_join_option = helpers.change_join_option;
    $scope.check_params_submit = helpers.check_params_submit;
    $scope.start_change = helpers.start_change;
    $scope.clear_choice_time = helpers.clear_choice_time;
    $scope.choice_time = helpers.choice_time;
    $scope.choice_room = helpers.choice_room;
    $scope.search_rooms = helpers.search_rooms;
    $scope.submit = helpers.submit;
    $scope.create_schedule = helpers.create_schedule;
    $scope.back = helpers.back;
    $scope.remove_room = helpers.remove_room;
    $scope.remove_member = helpers.remove_member;
    $scope.check_apply_repeat = helpers.check_apply_repeat;
    $scope.apply_repeat = helpers.apply_repeat;
    $scope.apply_choice_rooms = helpers.apply_choice_rooms;
    $scope.timeline_index = helpers.timeline_index;
    $scope.delay = helpers.delay;

    // INIT TYPES OF SCHEDULE
    $.ajax({
      url: base_url + 'api/schedules/get_type_schedules',
      type: 'GET',
      dataType: 'json',
      beforeSend: function() {
        showPageLoading();
      },
      success: function(e) {
        $scope.$apply(function() {
          switch(e.code) {
            case '500':
              showErrors(e.msg);
              break;
            case '200':
              $scope.types = e.data;
              break;
          }
        });
      },
      complete: function() {
        hidePageLoading();
      }
    });

    // INIT DROPZONE FILE UPLOAD
    init_dropzone($scope);

    // LOAD COLORS
    load_colors($scope);

    // INIT DATEPICKER
    init_datepicker();

    // INIT TIMEPICKER
    init_timepicker();

    // SELECT2 COUNTRIES
    init_country_select2();

    // SELECT2 COMPANIES
    init_company_select2();

    var now_time_zone = utcToCurrentTimezone(moment().utc());

    $scope.submit_data.start_date = now_time_zone.format('YYYY-MM-DD');
    $scope.submit_data.start_time = roundTime(now_time_zone, round_time_value).format('HH:mm');
    $scope.submit_data.end_date = now_time_zone.format('YYYY-MM-DD');
    $scope.submit_data.end_time = roundTime(now_time_zone.add(round_time_value, 'minute'), round_time_value).format('HH:mm');

    // INIT ROOM SELECT2
    init_room_select2($scope);

    // REPEAT
    $scope.first_popup_repeat = true;
    $scope.submit_data.repeat_to = now_time_zone.format('YYYY-MM-DD');
    $scope.submit_data.repeat_type = 'daily';
    $scope.submit_data.interval = '1';
    $scope.days = [];
    $scope.weekdays = weekdays(current_lang, 1);

    // INIT HOURS
    $scope.hours = create_array_hour(8, 20);

    // SEARCH ROOMS
    $scope.search_rooms();

    // MAPPING DATA
    execFunc(function() {
      $scope.submit_data.color_id = $scope.colors[0].id;
    });
  };


  //----------------------------------------------------------------------------------
  $('.select-repeat-type').on('change', function() {
    $scope.$apply(function() {
      if ($('.select-repeat-type').val() == 'weekly')
        $scope.is_weekly = true;
      else
        $scope.is_weekly = false;
    });
  });

  //----------------------------------------------------------------------------------
  $('.select-room').on('select2:select', function (e) {
    $scope.$apply(function() {
      if (!$scope.submit_data.rooms) $scope.submit_data.rooms = [];

      var exist = $scope.submit_data.rooms.find(function(d) {
        return d.id == e.params.data.id;
      });

      if (!exist) {
        e.params.data.data.members = [];
        $scope.submit_data.rooms.push(e.params.data.data);
      }

      $('.select-room').val(null).trigger('change');
    });
  });

  //----------------------------------------------------------------------------------
  $('.checkbox-repeat').change(function() {
    if ($(this).is(':checked')) {
      if ($scope.first_popup_repeat)
        $('#modalRepeat').modal('show');

      $('.g-datetime-no-repeat').hide();
      $('.g-datetime-repeat').show();
    } else {
      $('.g-datetime-repeat').hide();
      $('.g-datetime-no-repeat').show();
    }
  });

  //----------------------------------------------------------------------------------
  $('#modalRepeat').on('hidden.bs.modal', function () {
    if ($scope.first_popup_repeat)
      $('.checkbox-repeat').trigger('click');
  });

  //----------------------------------------------------------------------------------
  $('.btn-edit-repeat').click(function() {
    $('#modalRepeat').modal('show');
    return false;
  });

  //----------------------------------------------------------------------------------
  $('.checkbox-filter').change(function() {
    if (!$('.field-filter').is(':visible')) {
      $('.field-filter').show();
    } else {
      $('.field-filter').hide();
    }
  });

  //----------------------------------------------------------------------------------
  $('#modalSelectMultipleRooms').on('shown.bs.modal', function() {
    $("#fixTable").tableHeadFixer({
      "left": 1
    });
  });

});
main_app.controller('ScheduleEditController', function($scope, $rootScope, $location, $stateParams) {

  //----------------------------------------------------------------------------------
  scheduleInfoSockets($scope, $location);

  //----------------------------------------------------------------------------------
  var interval = setInterval(function() {
    if ($rootScope.first_load == false) {
      $rootScope.first_load = true;

      $.ajax({
        url: base_url + 'api/schedules/get_schedule_info?id=' + $stateParams.id,
        type: 'GET',
        dataType: 'json',
        beforeSend: function() {
          showPageLoading();
        },
        success: function(e) {
          $scope.$apply(function() {
            switch(e.code) {
              case '500':
                showErrors(e.msg);
                $location.path('/schedules');
                break;
              case '200':
                $scope.update_repeat_schedule = e.data.repeat ? true : false;

                if (e.data.start_time && e.data.end_time)
                  objToCurrentTimezone(e.data);
                else {
                  var now_time_zone = utcToCurrentTimezone(moment().utc());

                  e.data.end_date = moment(e.data.end_date).add(-1, 'day').format('YYYY-MM-DD');
                  e.data.start_time = roundTime(now_time_zone, round_time_value).format('HH:mm');
                  e.data.end_time = roundTime(now_time_zone.add(round_time_value, 'minute'), round_time_value).format('HH:mm');
                }

                e.data.start_time = moment(e.data.start_time, ['HH:mm']).format('HH:mm');
                e.data.end_time = moment(e.data.end_time, ['HH:mm']).format('HH:mm');

                $scope.submit_data = e.data;
                $scope.init_js();
                break;
            }
          });
        },
        complete: function() {
          hidePageLoading();
        }
      });

      clearInterval(interval);
    }
  }, 100);

  //----------------------------------------------------------------------------------
  $scope.init_js = function() {

    // INIT FUNCTION
    var helpers = schedule_info_helpers;
    helpers.setScope($scope, $rootScope, $location);

    $scope.class_timeline = classTimeline;
    $scope.repeat_string = helpers.repeat_string;
    $scope.choice_color = helpers.choice_color;
    $scope.change_join_option = helpers.change_join_option;
    $scope.check_params_submit = helpers.check_params_submit;
    $scope.start_change = helpers.start_change;
    $scope.clear_choice_time = helpers.clear_choice_time;
    $scope.choice_time = helpers.choice_time;
    $scope.choice_room = helpers.choice_room;
    $scope.search_rooms = helpers.search_rooms;
    $scope.submit = helpers.submit;
    $scope.update_schedule = helpers.update_schedule;
    $scope.back = helpers.back;
    $scope.remove_room = helpers.remove_room;
    $scope.remove_member = helpers.remove_member;
    $scope.check_apply_repeat = helpers.check_apply_repeat;
    $scope.apply_repeat = helpers.apply_repeat;
    $scope.apply_choice_rooms = helpers.apply_choice_rooms;
    $scope.timeline_index = helpers.timeline_index;
    $scope.delay = helpers.delay;
    $scope.check_update_type = helpers.check_update_type;
    $scope.update_type = helpers.update_type;

    // INIT TYPES OF SCHEDULE
    $.ajax({
      url: base_url + 'api/schedules/get_type_schedules',
      type: 'GET',
      dataType: 'json',
      beforeSend: function() {
        showPageLoading();
      },
      success: function(e) {
        $scope.$apply(function() {
          switch(e.code) {
            case '500':
              showErrors(e.msg);
              break;
            case '200':
              $scope.types = e.data;
              break;
          }
        });
      },
      complete: function() {
        hidePageLoading();
      }
    });

    // INIT DROPZONE FILE UPLOAD
    init_dropzone($scope);

    for (var i = 0; i < $scope.submit_data.files.length; i++) {
      var mockFile = {
        object: $scope.submit_data.files[i],
        name: $scope.submit_data.files[i].file_name,
        size: $scope.submit_data.files[i].file_size,
      };

      $scope.file_upload.options.addedfile.call($scope.file_upload, mockFile);

      if (isImage($scope.submit_data.files[i].file_url))
        $scope.file_upload.options.thumbnail.call($scope.file_upload, mockFile, $scope.submit_data.files[i].file_url);

      $scope.file_upload.files.push(mockFile);
    }

    // LOAD COLORS
    load_colors($scope);

    // INIT DATEPICKER
    init_datepicker();

    // INIT TIMEPICKER
    init_timepicker();

    // SELECT2 COUNTRIES
    init_country_select2();

    // SELECT2 COMPANIES
    init_company_select2();

    // INIT ROOM SELECT2
    init_room_select2($scope);

    // REPEAT
    $scope.first_popup_repeat = !($scope.submit_data.repeat ? true : false);
    $scope.submit_data.repeat_to = $scope.submit_data.repeat_to || moment().format('YYYY-MM-DD');
    $scope.submit_data.repeat_type = $scope.submit_data.repeat_type || 'daily';
    $scope.submit_data.interval = $scope.submit_data.interval || '1';
    $scope.is_weekly = ($scope.submit_data.repeat_type == 'weekly') ? true : false;
    $scope.days = [];
    $scope.weekdays = weekdays(current_lang, 1);

    if ($scope.submit_data.day_weeks) {
       var temp = $scope.submit_data.day_weeks.split(',');

      for (var i = 0; i < $scope.weekdays.length; i++)
        $scope.days[i] = (temp.indexOf($scope.weekdays[i].value) != -1) ? $scope.weekdays[i].value : '';
    }

    $('.select-repeat-type').val($scope.submit_data.repeat_type);
    $('.select-interval').val($scope.submit_data.interval);
    $('.repeat-to').val($scope.submit_data.repeat_to);

    // INIT HOURS
    $scope.hours = create_array_hour(8, 20);

    // SEARCH ROOMS
    $scope.search_rooms();

    // MAPPING DATA
    execFunc(function() {
      $scope.submit_data.color_id = $scope.submit_data.color_id || $scope.colors[0].id;
      $('.checkbox-repeat').trigger('change');
    });
  };


  //----------------------------------------------------------------------------------
  $('.select-repeat-type').on('change', function() {
    $scope.$apply(function() {
      if ($('.select-repeat-type').val() == 'weekly')
        $scope.is_weekly = true;
      else
        $scope.is_weekly = false;
    });
  });

  //----------------------------------------------------------------------------------
  $('.select-room').on('select2:select', function (e) {
    $scope.$apply(function() {
      if (!$scope.submit_data.rooms) $scope.submit_data.rooms = [];

      var exist = $scope.submit_data.rooms.find(function(d) {
        return d.id == e.params.data.id;
      });

      if (!exist) {
        e.params.data.data.members = [];
        $scope.submit_data.rooms.push(e.params.data.data);
      }

      $('.select-room').val(null).trigger('change');
    });
  });

  //----------------------------------------------------------------------------------
  $(document).on('change', '.checkbox-repeat', function() {
    if ($(this).is(':checked')) {
      if ($scope.first_popup_repeat)
        $('#modalRepeat').modal('show');

      $('.g-datetime-no-repeat').hide();
      $('.g-datetime-repeat').show();
    } else {
      $('.g-datetime-repeat').hide();
      $('.g-datetime-no-repeat').show();
    }
  })

  //----------------------------------------------------------------------------------
  $('#modalRepeat').on('hidden.bs.modal', function () {
    if ($scope.first_popup_repeat)
      $('.checkbox-repeat').trigger('click');
  });

  //----------------------------------------------------------------------------------
  $('.btn-edit-repeat').click(function() {
    $('#modalRepeat').modal('show');
    return false;
  });

  //----------------------------------------------------------------------------------
  $('.checkbox-filter').change(function() {
    if (!$('.field-filter').is(':visible')) {
      $('.field-filter').show();
    } else {
      $('.field-filter').hide();
    }
  });

  //----------------------------------------------------------------------------------
  $('#modalSelectMultipleRooms').on('shown.bs.modal', function() {
    $("#fixTable").tableHeadFixer({
      "left": 1
    });
  });

});
